"""
test heapsort
"""
import unittest
import operator
import random
import heapsort

class HeapsortTest(unittest.TestCase):
    """
    Test heapsort implementation
    """
    def test_swim1(self):
        arr = [1, 2, 3, 4]
        heapsort._swim(arr, 2, operator.lt)
        self.assertEqual(arr, [3, 2, 1, 4])

    def test_swim2(self):
        arr = [1, 2, 3, 4]
        heapsort._swim(arr, 3, operator.lt)
        self.assertEqual(arr, [4, 1, 3, 2])

    def test_sink1(self):
        arr = [1, 2, 3, 4]
        heapsort._sink(arr, 0, 4, operator.lt)
        self.assertEqual(arr, [3, 2, 1, 4])

    def test_sink2(self):
        arr = [1, 3, 2, 4]
        heapsort._sink(arr, 0, 4, operator.lt)
        self.assertEqual(arr, [3, 4, 2, 1])

    def test_sink3(self):
        arr = [1, 3, 2, 4, 7, 5]
        heapsort._sink(arr, 2, 6, operator.lt)
        self.assertEqual(arr, [1, 3, 5, 4, 7, 2])

    def test_sink4(self):
        arr = [1, 3, 2, 4, 7, 5]
        heapsort._sink(arr, 0, 6, operator.lt)
        self.assertEqual(arr, [3, 7, 2, 4, 1, 5])

    def test_sink_partial(self):
        arr = [1, 3, 2, 4, 7, 5]
        heapsort._sink(arr, 0, 4, operator.lt)
        self.assertEqual(arr, [3, 4, 2, 1, 7, 5])

    def test_sort1(self):
        arr = [3, 2, 5, 1, 4]
        heapsort.sort(arr)
        self.assertEqual(arr, [1, 2, 3, 4, 5])

